 token exists","params":{"_tokenId":"uint256 ID of the token to query the existence of"},"return":"whether the token exists"},"getApproved(uint256)":{"details":"Gets the approved address for a token ID, or zero if no address set","params":{"_tokenId":"uint256 ID of the token to query the approval of"},"return":"address currently approved for the given token ID"},"getEvent(uint256)":{"details":"Function to show information about the event.","params":{"_id":"uint - Event ID."},"return":"name string - The name of the event.time uint - The time of the event.price uint - The price of the event.token bool - If true the price is in tokens, else the price is in ethereum.limited bool - If true event has limited seats.seats uint - If event has limited seats, show how much tickets can be sold.sold uint - Number of sold tickets.ipfs string - The IPFS hash containing additional information about event.owner address - The owner of the event."},"getEventsCount()":{"details":"Function returns number of all events.","return":"uint - Number of events."},"getTicket(uint256)":{"details":"Function to show ticket information.","params":{"_id":"uint - Ticket ID."},"return":"uint - Event ID.uint - Ticket seat."},"isApprovedForAll(address,address)":{"details":"Tells whether an operator is approved by a given owner","params":{"_operator":"operator address which you want to query the approval of","_owner":"owner address which you want to query the approval of"},"return":"bool whether the given operator is approved by the given owner"},"name()":{"details":"Gets the token name","return":"string representing the token name"},"ownerOf(uint256)":{"details":"Gets the owner of the specified token ID","params":{"_tokenId":"uint256 ID of the token to query the owner of"},"return":"owner address currently marked as the owner of the given token ID"},"pause()":{"details":"called by the owner to pause, triggers stopped state"},"renounceOwnership()":{"details":"Allows the current owner to relinquish control of the contract."},"safeTransferFrom(address,address,uint256)":{"details":"Safely transfers the ownership of a given token ID to another address If the target address is a contract, it must implement `onERC721Received`, which is called upon a safe transfer, and return the magic value `bytes4(keccak256(\\"onERC721Received(address,address,uint256,bytes)\\"))`; otherwise, the transfer is reverted.   * Requires the msg sender to be the owner, approved, or operator","params":{"_from":"current owner of the token","_to":"address to receive the ownership of the given token ID","_tokenId":"uint256 ID of the token to be transferred"}},"safeTransferFrom(address,address,uint256,bytes)":{"details":"Safely transfers the ownership of a given token ID to another address If the target address is a contract, it must implement `onERC721Received`, which is called upon a safe transfer, and return the magic value `bytes4(keccak256(\\"onERC721Received(address,address,uint256,bytes)\\"))`; otherwise, the transfer is reverted. Requires the msg sender to be the owner, approved, or operator","params":{"_data":"bytes data to send along with a safe transfer check","_from":"current owner of the token","_to":"address to receive the ownership of the given token ID","_tokenId":"uint256 ID of the token to be transferred"}},"setApprovalForAll(address,bool)":{"details":"Sets or unsets the approval of a given operator An operator is allowed to transfer all tokens of the sender on their behalf","params":{"_approved":"representing the status of the approval to be set","_to":"operator address to set the approval"}},"supportsInterface(bytes4)":{"details":"implement supportsInterface(bytes4) using a lookup table"},"symbol()":{"details":"Gets the token symbol","return":"string representing the token symbol"},"ticketsOf(address)":{"details":"Function to show all tickets of the specified address.","params":{"_owner":"address - The address to query the tickets of."},"return":"uint[] - Array of tickets ID."},"